<?php

require_once( DIR_SYSTEM . "/engine/neoseo_model.php");

class ModelModuleNeoSeoGeoip extends NeoSeoModel
{

	public function __construct($registry)
	{
		parent::__construct($registry);
		$this->_moduleSysName = 'neoseo_geoip';
		$this->_logFile = $this->_moduleSysName . '.log';
		$this->debug = $this->config->get($this->_moduleSysName . '_debug') == 1;

		$this->params = array(
			'status' => 1,
			'api_key' => '',
			'debug' => 0,
			'allow_change_language' => 1,
			'allow_change_currency' => 1,
		);
	}

	public function install()
	{
		// Значения параметров по умолчанию
		$this->initParams($this->params);

		// Создаем новые и недостающие таблицы в актуальной структуре
		$this->installTables();


		return TRUE;
	}

	public function installTables(){
		$result = $this->db->query("SHOW TABLES LIKE '" . DB_PREFIX . "geoip_city'");
		if(!$result->num_rows){
			$this->installGeoipCity();
		}

		$result = $this->db->query("SHOW TABLES LIKE '" . DB_PREFIX . "geoip_country'");
		if(!$result->num_rows){
			$this->installGeoipCountry();
		}

		$result = $this->db->query("SHOW TABLES LIKE '" . DB_PREFIX . "geoip_customer_groups'");
		if(!$result->num_rows){
			$this->installGeoipCgroups();
		}

		$result = $this->db->query("SHOW TABLES LIKE '" . DB_PREFIX . "geoip_mapping'");
		if(!$result->num_rows){
			$this->installGeoipMapping();
		}

		$result = $this->db->query("SHOW TABLES LIKE '" . DB_PREFIX . "geoip_region'");
		if(!$result->num_rows){
			$this->installGeoipRegion();
		}

		$result = $this->db->query("SHOW TABLES LIKE '" . DB_PREFIX . "geoip_localization'");
		if(!$result->num_rows){
			$this->installGeoipLocalization();
		}

	}

	public function upgrade(){

		// Добавляем недостающие новые параметры
		$this->initParams($this->params);

		// Создаем недостающие таблицы в актуальной структуре
		$this->installTables();

	}

	public function uninstall()
	{
		$this->db->query("DROP TABLE `" . DB_PREFIX . "geoip_city`");
		$this->db->query("DROP TABLE `" . DB_PREFIX . "geoip_country`");
		$this->db->query("DROP TABLE `" . DB_PREFIX . "geoip_customer_groups`");
		$this->db->query("DROP TABLE `" . DB_PREFIX . "geoip_mapping`");
		$this->db->query("DROP TABLE `" . DB_PREFIX . "geoip_region`");
		$this->db->query("DROP TABLE `" . DB_PREFIX . "geoip_localization`");

		return TRUE;
	}

	private function installGeoipLocalization()
	{
		$this->db->query("CREATE TABLE IF NOT EXISTS `" . DB_PREFIX . "geoip_localization` ("
			."`country_id` int(11) NOT NULL, "
			."`lang_id` varchar(5) NOT NULL, "
			."`currency_id` varchar(3) NOT NULL,"
			."PRIMARY KEY (`country_id`) "
			.") ENGINE=InnoDB;");
	}

